  \"2015-09-27T01:40:59.648515\",\n\t\"name\": \"salinity-total-nitrogen-water-temperature-particulate-organic-carbon-and-other-profile-and-disc\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115198 includes profile,
  discrete sample, physical and chemical data collected aboard the ATLANTIS, NEW HORIZON
  and WECOMA during cruises AT7-21, NH0307A, W0002A, W0004B, W0007A, W0009A, W0101C,
  W0103B, W0107A, W0109A, W0111B, W0202A, W0204A, W0207A, W0212A, W0302A, W0304A,
  W0309B, W0408D, W9709B, W9711C, W9801B, W9804A, W9808A, W9809A, W9811A, W9902A,
  W9904B, W9907A, W9909C and W9911A in the North Pacific Ocean from 1997-09-19 to
  2004-09-02. These data include SALINITY, Total nitrogen, WATER TEMPERATURE, PARTICULATE
  ORGANIC CARBON, Dissolved Organic Nitrogen, DISSOLVED ORGANIC CARBON, CARBON - TOTAL
  ORGANIC and PARTICULATE ORGANIC NITROGEN. The instruments used to collect these
  data include bottle, Total Organic Carbon (TOC) Analyzer, Nutrient Autoanalyzer
  and CHN Analyzer. These data were collected by Patricia Wheeler of Oregon State
  University as part of NEP. The Biological and Chemical Oceanography Data Management
  Office (BCO-DMO) submitted these data to NODC on 2013-10-30.nnThe following is the
  text of the abstract provided by BCO-DMO:nnThis dataset contains particulate and
  dissolved organic carbon and nitrogen data from the GLOBEC Northeast Pacific (NEP)
  Long-Term Observation Program (LTOP) cruises from 1997 to 2004. The nutrient and
  extracted chlorophyll data that correspond to this dataset can be also be found
  in the BCO-DMO database (http://cis.whoi.edu/science/bcodmo-admin/dataset.cfm?id=10184&flag=view).nFor
  further hydrographic information from all cruises, see cruise reports provided on
  the Northeast Pacific Long Term Observation Program website (http://ltop.coas.oregonstate.edu/~ctd/index.html),
  or contact Dr. A Huyer at Oregon State University, COAS,104 COAS Admin. Bldg., Corvallis,
  OR, 97331-5503. All particulate and dissolved organic carbon and nitrogen data in
  this dataset include cruise station numbers to allow comparison with the hydrographic
  information found in other data reports.\",\n\t\"license_title\": null,\n\t\"extras\":
